    true,nt"url": null,nt"notes": "AIRS/Aqua Level 3 pentad quantization product
    in physical units (AIRS Only).n      nThe quantization products (QP) are distributional
    summaries derived from the Level-2 standard retrieval products (of swath type) to
    provide a more comprehensive set of statistical summaries than the traditional means
    and standard deviation. The QP products combine the Level 2 standard data parameters
    over grid cells of 5 x 5 deg spatial extent for temporal periods of five days. Pentads
    always start on the 1st, 6th, 11th, 16th, 21st, and 26th days of the month and may
    contain as few as 3 days of data or as much as 6 days. They preserve the multivariate
    distributional features of the original data and so provide a compressed data set
    that more accurately describes the disparate atmospheric states that is in the original
    Level-2 swath data set.n      nThe geophysical parameters are: Air Temperature and
    Water Vapor profiles (11 levels/layers), Cloud fraction (vertical distribution).n
         n(The Shortname for this product is AIRS3QP5)",nt"license_title": "U.S.
